import React, { Component } from 'react';

class RecipeSearchButtons extends Component {
    render() {
        const {searchRecipes} = this.state
        return (
            <>
                <button className="btn btn-success mr-3" onChange={searchRecipes}>Best Recipes</button>
                <button className="btn btn-danger" onChange={searchRecipes}>Worst Recipes</button>
            </>
        );
    }
}

export default RecipeSearchButtons;
